/**
 * @param {number} n
 * @param {number[][]} edges
 * @return {number[]}
 */

class Cache {
  hash = {}

  clear() {
    this.hash = {}
  }

  find(fromNode, toNode) {
     if (this.hash[fromNode] === undefined) this.hash[fromNode] = {}
     return this.hash[fromNode][toNode]
  }

  push(fromNode, toNode, value) {
     this.hash[fromNode][toNode] = value
  }
 }
let cache = new Cache

const addOne = v => parseInt(v) + 1
const unique = (value, index, array) => array.indexOf(value) === index
const asc = (a,b) => a - b
const hasValue = v => v !== undefined

const getNodes = edges => edges.flatMap(edges => edges)
  .sort(asc)
  .filter(unique)

const getEdgesFromNode = (node, edges) => {
  return edges.map(edge => {
    if (edge.indexOf(node) >= 0) {
      if (edge[0] === node) return edge
      else return [edge[1], edge[0]]
    }
    return undefined
  }).filter(hasValue)
}

const removeEdge = (node1, node2, edges) => edges.filter(edge => !(edge.indexOf(node1) >= 0 && edge.indexOf(node2) >= 0))

const getMaxmimumLine = (fromNode, toNode, edges) => {

  // Cache check
  if (fromNode !== undefined) {
    const fromCacheValue = cache.find(fromNode, toNode)
    if (fromCacheValue !== undefined) return fromCacheValue
  }

  edgesFromNode = getEdgesFromNode(toNode, edges)

  if (edgesFromNode.length === 0) return 0
  const nextNodes = getNodes(edgesFromNode).filter(v => v !== toNode)


  return Math.max(...nextNodes.map(nextNode => {
    // Cache check
    const fromCacheValue = cache.find(toNode, nextNode)
    if (fromCacheValue !== undefined) return fromCacheValue

    const depth = 1 + getMaxmimumLine(toNode, nextNode, removeEdge(toNode, nextNode, edges))

    // Push to cache
    cache.push(toNode, nextNode, depth)
    return depth
  }))
}

const findMinHeightTrees = (n, edges) => {
  cache.clear()

  const nodes = getNodes(edges)
  console.log(nodes)

  const heightestDepths = nodes.map(node => getMaxmimumLine(undefined, node, edges))
  const minimumHeight = Math.min(...heightestDepths)
  console.log('minimumHeight = ', minimumHeight)
  const result = heightestDepths.map((depth, index) => depth === minimumHeight ? nodes[index] : undefined).filter(hasValue)
  return result.length > 0 ? result : [0]
}

